// contracts/VoteToken.sol
// SPDX-License-Identifier: MIT
pragma solidity ^0.6.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "./interfaces/DemandFactory.sol";

contract VoteToken is ERC20 {

  struct voteInfo{
    uint voteNum; //
    address[] voters; //
  }
  mapping(uint => voteInfo) public votes_agree; //
  mapping(uint => voteInfo) public votes_against; //
  mapping(address => mapping(uint => bool)) public is_voted; //
  address receiver = address(0);
  DemandFactory demandFactory;
  address public admin;

  event addAgree(uint _id,address sender,uint voteTime); //
  event addAgainst(uint _id,address sender,uint voteTime); //
  event voteThrough(uint _id,uint voteTime); //
  event voteNotThrough(uint _id,uint voteTime); //

  constructor(uint256 initialSupply,address demandFactoryAddress) public ERC20("VoteToken", "Vote") {
    _mint(msg.sender, initialSupply);
    receiver=msg.sender;
    demandFactory = DemandFactory(demandFactoryAddress);
    admin = msg.sender;
  }

  //  0: 1 2 3 4
  function getVoteStatus(uint _id) public view returns(uint8 status) {
    uint  id;          //
    string memory username;  // or  
    address  sender;   //address
    string memory content;   //
    string memory contact;   //
    uint  getStatus;      // 0: 1 2 3 4
    (id,username,sender,content,contact,getStatus) = demandFactory.demands(_id);
    uint8 passBaseLineNum = 2;
    uint8 failBaseLineNum = 2;

    if(getStatus!=0){
      return uint8(getStatus);
    }else{
      //
      if(
        votes_agree[_id].voteNum<passBaseLineNum &&
        votes_against[_id].voteNum<failBaseLineNum
      ){
        return 0;
      }else if(votes_agree[_id].voteNum>=passBaseLineNum){
        return 1;
      }
    }
    
    return 4;

  }


  // 
  function agree(uint _id) public{
    require(getVoteStatus(_id)==0,"vote closed");
    require(is_voted[msg.sender][_id]==false,"You've already voted!");
    require(balanceOf(msg.sender)>=1,"You don't have enough tokens!");

    _burn(msg.sender, 1);
    //_mint(receiver, 1);
    is_voted[msg.sender][_id]=true;
    votes_agree[_id].voters.push(msg.sender);
    votes_agree[_id].voteNum++;

    emit addAgree(_id,msg.sender,now);
    if(getVoteStatus(_id)==1){
      demandFactory.update(_id);
      emit voteThrough(_id,now);
    }
  }
  
  // 
  function against(uint _id) public{
    require(getVoteStatus(_id)==0,"vote closed");
    require(is_voted[msg.sender][_id]==false,"You've already voted!");
    require(balanceOf(msg.sender)>=1,"You don't have enough tokens!");

    _burn(msg.sender, 1);
    //_mint(receiver, 1);
    is_voted[msg.sender][_id]=true;
    votes_against[_id].voters.push(msg.sender);
    votes_against[_id].voteNum++;

    emit addAgainst(_id,msg.sender,now);
    if(getVoteStatus(_id)==4){
      demandFactory.failed(_id);
      emit voteNotThrough(_id,now);
    }
  }

  // 
  function getVotesCount(uint _id) public view returns(uint agreeNum ,uint againstNum){
    agreeNum=votes_agree[_id].voteNum;
    againstNum=votes_against[_id].voteNum;
  }

  // 
  function getAllVoters(uint _id) public view returns(address[] memory agree_voters,address[] memory against_voters){
    agree_voters=votes_agree[_id].voters;
    against_voters=votes_against[_id].voters;
  }
  
  //
  function destroy() public{      
    require(admin == msg.sender,"not permit");
    selfdestruct(msg.sender);
  }
}
